import React from 'react';
import { useHistory } from 'react-router-dom';

const Signup = () => {
  const history = useHistory();

  const handleNavigateToTerms = () => {
    history.push('/terms');
  };

  const handleNavigateToPrivacy = () => {
    history.push('/privacy');
  };

  const handleNavigateToSignin = () => {
    history.push('/Signin');
  };

  return (
    <div className="bg-zinc-100 h-screen flex justify-center items-center">
      <div className="bg-white h-96 pl-10 w-[400px] space-y-3 flex flex-col justify-center">
        <form className='space-y-3' action=''>
          <div>
            <p className='font-semibold text-2xl tracking-wide text-center'>Signup</p>
          </div>
          <div className="mr-5">
            <input className="outline-none h-10 px-10 border border-sm w-full flex justify-center items-center mb-4"
              type="text"
              placeholder="name"
              required
            />
          </div>
          <div className="mr-5">
            <input className="outline-none h-10 px-5 border border-sm w-full"
              type="email"
              placeholder="email"
              required
            />
          </div>
          <div className="mr-5">
            <input className="outline-none h-10 px-5 border border-sm w-full"
              type="password"
              placeholder="password"
              required
            />
          </div>
          <div>
            <input type="checkbox" />
            <p>I agree to the healthcare <a onClick={handleNavigateToTerms}>terms of service</a> and <a onClick={handleNavigateToPrivacy}>privacy policy</a></p>
          </div>
          <div>
            <button>Signup</button>
            <p>If you have an account? <a onClick={handleNavigateToSignin}>Signin</a></p>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Signup;
